--Update the bill amount--

UPDATE t
SET t.CUST_BILL_AMT = (f.BASE_FARE + (t.DISTANCE_MILES * s.SURGE_FACTOR)) -  
					  (0.01* c.DISCOUNT_PERCENT *(f.BASE_FARE + (t.DISTANCE_MILES * s.SURGE_FACTOR)))
	FROM trip t, vehicle_base_fare f, vehicle v, time_surge s, coupon c
WHERE t.VEH_REG_NO = v.VEH_REG_NO and
v.VEH_TYPE = f.VEH_TYPE and
c.COUPON_ID = t.COUPON_ID and --If no coupon is applied, then coupon code 'NONE' is used with 0% discount--
cast(t.START_TIME as time) between s.START_TIME and s.END_TIME;

--Update driver and company share--
UPDATE t
SET	t.DRIVER_SHARE = 0.8 *  CUST_BILL_AMT,
 t.COMPANY_SHARE = 0.2 * CUST_BILL_AMT
FROM trip t, vehicle_base_fare f, vehicle v, time_surge s, coupon c
WHERE t.VEH_REG_NO = v.VEH_REG_NO and
v.VEH_TYPE = f.VEH_TYPE and
c.COUPON_ID = t.COUPON_ID and
cast(t.START_TIME as time) between s.START_TIME and s.END_TIME;


